script: |
  super -f text -I q9940.spq | sort > q9940.out

inputs:
  - name: q9940.spq
    data: |
      SELECT DISTINCT - 39 * + - 84 AS col1 FROM tab1 (FORMAT parquet) WHERE + col1 BETWEEN + 74 * + ( col2 ) AND - ( + - col2 ) * 32 + ( - col2 ) * ( + 64 ) - + 37;
  - name: tab1

outputs:
  - name: q9940.out
    data: |
